import "./topbar.css"
import { Link } from 'react-router-dom';

export default function TopBar() {

    let user = localStorage.getItem("token")

    function logout() {
        // localStorage.clear();
        // window.location = '/';
        console.log('hello')
    }
  return (
    <div className='top'>
        <div className="topLeft">
            <i className="topIcon fa-brands fa-facebook-f"></i>
            <i className="topIcon fa-brands fa-twitter"></i>
            <i className="topIcon fa-brands fa-instagram"></i>
        </div>
        <div className="topCenter">
            <nav className="toplist">
                {user ? 
                <>
                    <Link to="/" className="topListItem">Home</Link>
                    <Link to="/Write" className="topListItem">Write</Link>
                    <Link to="/settings" className="topListItem">Settings</Link>
                    <Link to ="#" className="topListItem" onclick={logout()}>Logout</Link>
                </>
                :
                <>
                  <Link to="/login" className="topListItem">Login</Link>
                  <Link to="/register" className="topListItem">Register</Link>
                </>}
               
        
              
            </nav>
        </div>
        <div className="topRight">
            <img className='topImg'src="https://64.media.tumblr.com/acc6c3240f74cabdf44f5958ec2017ed/35c3a530be68f154-a5/s540x810/8ffc971ef15056ab0e75d8aba6e9cee530e2b99d.png" alt='profil'></img>
            <i className="searchIcon fa-solid fa-magnifying-glass"></i>    
        </div>
    </div>
  )
}
